sys_variable_value.value:
(function execute(inputs, outputs) {

  //Increment the counter
  var i = parseInt(inputs.i);
  i++;
  outputs.i = i

  //Calculate the average records per minute.
  //Math: we get records/minute with the formula:   i[records] * 60[seconds/minute] / (current_time - start_time)[seconds] = records/minute
  var current_time = new GlideDateTime()
  var start_time = new GlideDateTime(inputs.start_time)  
  var time_delta = GlideDateTime.subtract(start_time,current_time)
  var time_delta_seconds = time_delta.getNumericValue() / 1000; //This is in milliseconds, so we divide by 1000 to get seconds
  //outputs.debug = "" + current_time.toString() + " - " + start_time.toString() + " = " + time_delta.toString() + " ( " + time_delta_seconds.toString() + " s ) " +  i
  outputs.average_records_per_minute = i*60/time_delta_seconds

})(inputs, outputs);

